export default (function(a,b,c,d,e,f,g){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:5}}},HpeYdECbHo:{data:{id:2450,attributes:{imdbId:"tt7126948",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BYTlhNzJjYzYtNGU3My00ZDI5LTgzZDUtYzllYjU1ZmU0YTgwXkEyXkFqcGdeQXVyMjQwMDg0Ng@@._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"5.4\u002F10"},{Source:"Rotten Tomatoes",Value:"58%"},{Source:"Metacritic",Value:"60\u002F100"}],item_lang:{data:{id:3113,attributes:{title:"Wonder Woman 1984",plot:"In 1984, after saving the world in Wonder Woman (2017), the immortal Amazon warrior, Princess Diana of Themyscira, finds herself trying to stay under the radar, working as an archaeologist at the Smithsonian Museum. With the memory of the brave U.S. pilot, Captain Steve Trevor, etched on her mind, Diana Prince becomes embroiled in a sinister conspiracy of global proportions when a transparent, golden-yellow citrine gemstone catches the eye of the power-hungry entrepreneur, Maxwell Lord. Now, as a dear old friend from the past miraculously enters the picture, and Barbara Minerva, Diana's insecure gemologist colleague gives in to desire, suddenly, deceit, greed, and false promises catapult Maxwell into the limelight. More and more, cataclysmic events push the world to the brink, and emotionally vulnerable Diana must address a cruel dilemma. Can mighty Wonder Woman save humankind once again?",slug:"wonder-woman-1984"}}},books:{data:[{id:11843,attributes:{title:g,description:"Wonder Woman, arguably the best-known female superhero in the world and star of her own monthly comics, was introduced in the early 1940s in these quirky tales written by the inventor of the lie detector, psychologist William Moulton Marston. In these stories, Wonder Woman travels from Paradise Island to Man's World, where she serves as an emissary of peace, using her bracelets and lasso of truth to stop injustice. These stories introduce the mythology of Wonder Woman as she battles the powers of evil--from crooked business owners to Nazi spies. Collects ALL STAR COMICS #8, SENSATION COMICS #1-14 and WONDER WOMAN #1-3 and COMIC CAVALCADE #1.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=iHThAQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:true,published:"2017-01-01",publisher:a,subtitle:a}},{id:11844,attributes:{title:"Wonder Woman: the Golden Age Omnibus",description:"Wonder Woman, the best-known female superhero in the world and star of her own monthly comics, faced the evil of the Axis powers in these World War II-era tales. In these stories, Wonder Woman protects Man's World, using her bracelets and lasso of truth to stop injustice. These tales include Wonder Woman's battle to keep innocents from being drawn into a land of nightmares and sees her sending a gangster to Paradise Island to be reformed, attending a costume party to prevent a murder and much more! Collects COMIC CAVALCADE #5-12, SENSATION COMICS #25-48 and WONDER WOMAN #8-15.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=7FkWMQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"2017-07-11",publisher:a,subtitle:a}},{id:11845,attributes:{title:"Wonder Woman - Archives",description:"The next volume of classic Wonder Woman stories is here, collecting SENSATION COMICS #33-40 and WONDER WOMAN #10-12!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=-4esPQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b,"H. G. Peter"],firstBook:d,published:"2007-01-01",publisher:"Dc Comics",subtitle:a}},{id:11846,attributes:{title:"Golden Age",description:"The earliest adventures of Wonder Woman are collected in this new trade paperback graphic novel series, continuing with WONDER WOMAN: THE GOLDEN AGE VOL. 2! The most famous of all the women who have ever been called a superhero, Wonder Woman exploded into the world of comic books amid the uncertainty and bleak determination of World War II. Fighting for justice and treating even her enemies with firm compassion, Wonder Woman brought not a cape nor a ring nor a personal fortune or hidden clubhouse, but a magic lasso that compelled anyone it held to tell the truth, and bracelets that could not only deflect bullets but prevent Wonder Woman from ever using her superpowers for unchecked destruction. The earliest stories of the Amazon Warrior are collected here in WONDER WOMAN: THE GOLDEN AGE VOL. 2, featuring the adventures of Wonder Woman as she tackles corruption, oppression and cruelty in the early days of World War II. Collects SENSATION COMICS #15-24, WONDER WOMAN #4-7 and COMIC CAVALCADE #2-5",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=sMxitQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"2018-08-08",publisher:a,subtitle:a}},{id:11847,attributes:{title:g,description:"Just a few years after she burst into comic books, the world's most famous female superhero starred in her own daily newspaper strip written and drawn by the same creative team that produced the comic book: William Moulton Marston and Harry G. Peters. The strip lasted a little more than a year and a half - from May 1, 1944 until December 1, 1945 - and is reprinted here for the first time. It all starts on Paradise Island where Amazonian women rule supreme and no men are allowed. Led by Princess Diana, their way of life is about to change when when Steve Trevor, a wounded American soldier, washes up on their shores. Soon, Diana - rechristened Wonder Woman - is off to America, where the saga continues!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=SdiIoAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"2014-10-21",publisher:"Idea & Design Works Llc",subtitle:"The Complete Dailies 1944-1945"}}]}}},meta:{}}},prerenderedAt:1681377208019}}("","William Moulton Marston","movie",null,"series",1,"Wonder Woman"))